  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Niobrara
  National Wildlife Refuge outlines Refuge accomplishments from November, 1939 to
  January, 1940. The report begins by summarizing the weather conditions. Wildlife-
  including migratory birds, big game animals, furbearers, predators, and rodents-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. The public relations section of the report describes recreational
  uses. Resource management is outlined; topics include grazing.\",\n\t\"owner_org\":
